import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to load the profile section
    // Using getByRole for better accessibility and robustness
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for the profile page content to be dynamically rendered
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').innerText();
    const username = await page.locator('.profile-info .username').innerText();
    const bio = await page.locator('.profile-info .bio').innerText();
    const totalOrders = await page.locator('.stat:has-text("Orders") .stat-number').innerText();
    const totalReviews = await page.locator('.stat:has-text("Reviews") .stat-number').innerText();
    const sellerRating = await page.locator('.stat:has-text("Seller Rating") .stat-number').innerText();

    const extractedData = {
      fullName,
      username,
      bio,
      stats: {
        totalOrders: parseInt(totalOrders, 10),
        totalReviews: parseInt(totalReviews, 10),
        sellerRating: parseFloat(sellerRating)
      }
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
